     &  -0.795530E+01, -0.131630E+02, -0.110681E+02, -0.835201E+00, -0.178149E+01, 
     &  -0.658809E+01, -0.165669E+01, -0.490160E+01, -0.252179E+01, -0.693100E+01, 
     &  -0.343519E+01, -0.521889E+01, -0.647869E+01, -0.259169E+01, -0.434479E+01, 
     &  -0.536430E+01, -0.382108E+01, -0.519619E+01, -0.803799E+01, -0.949480E+01, 
     &  -0.422049E+01 /
	data abun17(          42,          18,1:26) /
     &  -0.504376E+01, -0.142468E+00, -0.110467E+01, -0.131393E+02, -0.585518E+01, 
     &  -0.770968E+01, -0.133507E+02, -0.110031E+02, -0.823070E+00, -0.174478E+01, 
     &  -0.557347E+01, -0.164537E+01, -0.437727E+01, -0.251317E+01, -0.634227E+01, 
     &  -0.322547E+01, -0.520607E+01, -0.646457E+01, -0.258576E+01, -0.408606E+01, 
     &  -0.513756E+01, -0.383348E+01, -0.514337E+01, -0.796186E+01, -0.937716E+01, 
