	end module Morley17


	subroutine MorleyChemistry(abun0,T0,P0,molname0,ZZ)
	use MorleyPTgrid
	use Morley00
	use Morley03
	use Morley05
	use Morley07
	use Morley10
	use Morley15
	use Morley17
	IMPLICIT NONE
	real*8 P0,T0,wP1,wP2,wT1,wT2,abun0,ZZ,ww
	real*8 abun_tot00,abun_tot03,abun_tot05,abun_tot07,abun_tot10,abun_tot15,abun_tot17
	character*10 molname0
	integer iT1,iP1,iT2,iP2,iM
	character*10 molname(nM)
	parameter(molname = (/'e-    ','H2    ','H     ','H+    ','HI    ','H2-   ',
     &  'H2+   ','H3+   ','He    ','H2O   ','CH4   ','CO    ','NH3   ','N2    ',
     &  'PH3   ','H2S   ','TiO   ','VO    ','Fe    ','FeH   ','CrH   ','Na    ',
     &  'K     ','Rb    ','Cs    ','CO2   ' /))
	
	do iM=1,nM
		if(molname(iM).eq.molname0) goto 1
	enddo
	abun0=0d0
	return

1	continue


	if(T0.lt.T(1)) then
		iT1=1
	else if(T0.gt.T(nT)) then
		iT1=nT-1
	else
		do iT1=1,nT-1
			if(T0.le.T(iT1+1)) exit
		enddo
	endif
	iT2=iT1+1

	if(P0.lt.P(1)) then
		iP1=1
	else if(P0.gt.P(nP)) then
		iP1=nP-1
	else
		do iP1=1,nP-1
			if(P0.le.P(iP1+1)) exit
		enddo
	endif
	iP2=iP1+1

	wT1=abs(T0-T(iT2))/(T(iT2)-T(iT1))
	wT2=1d0-wT1
	if(T0.lt.T(1)) then
		wT1=1d0
		wT2=0d0
	endif
	if(T0.gt.T(nT)) then
		wT1=0d0
		wT2=1d0
	endif
	wP1=log(P(iP2)/P0)/log(P(iP2)/P(iP1))
	wP2=1d0-wP1
	if(P0.lt.P(1)) then
		wP1=1d0
		wP2=0d0
	endif
	if(P0.gt.P(nP)) then
		wP1=0d0
		wP2=1d0
	endif

	abun_tot00=wT1*(wP1*abun00(iT1,iP1,iM)+wP2*abun00(iT1,iP2,iM))+wT2*(wP1*abun00(iT2,iP1,iM)+wP2*abun00(iT2,iP2,iM))
	abun_tot03=wT1*(wP1*abun03(iT1,iP1,iM)+wP2*abun03(iT1,iP2,iM))+wT2*(wP1*abun03(iT2,iP1,iM)+wP2*abun03(iT2,iP2,iM))
	abun_tot05=wT1*(wP1*abun05(iT1,iP1,iM)+wP2*abun05(iT1,iP2,iM))+wT2*(wP1*abun05(iT2,iP1,iM)+wP2*abun05(iT2,iP2,iM))
	abun_tot07=wT1*(wP1*abun07(iT1,iP1,iM)+wP2*abun07(iT1,iP2,iM))+wT2*(wP1*abun07(iT2,iP1,iM)+wP2*abun07(iT2,iP2,iM))
	abun_tot10=wT1*(wP1*abun10(iT1,iP1,iM)+wP2*abun10(iT1,iP2,iM))+wT2*(wP1*abun10(iT2,iP1,iM)+wP2*abun10(iT2,iP2,iM))
	abun_tot15=wT1*(wP1*abun15(iT1,iP1,iM)+wP2*abun15(iT1,iP2,iM))+wT2*(wP1*abun15(iT2,iP1,iM)+wP2*abun15(iT2,iP2,iM))
	abun_tot17=wT1*(wP1*abun17(iT1,iP1,iM)+wP2*abun17(iT1,iP2,iM))+wT2*(wP1*abun17(iT2,iP1,iM)+wP2*abun17(iT2,iP2,iM))

 	if(ZZ.le.0d0) then
		abun0=abun_tot00
	else if(ZZ.le.0.3) then
		ww=((0.3-ZZ)/0.3)
		abun0=ww*abun_tot00+(1d0-ww)*abun_tot03
	else if(ZZ.le.0.5) then
		ww=((0.5-ZZ)/0.2)
		abun0=ww*abun_tot03+(1d0-ww)*abun_tot05
	else if(ZZ.le.0.7) then
		ww=((0.7-ZZ)/0.2)
		abun0=ww*abun_tot05+(1d0-ww)*abun_tot07
	else if(ZZ.le.1.0) then
		ww=((1.0-ZZ)/0.3)
		abun0=ww*abun_tot07+(1d0-ww)*abun_tot10
	else if(ZZ.le.1.5) then
		ww=((1.5-ZZ)/0.5)
		abun0=ww*abun_tot10+(1d0-ww)*abun_tot15
	else if(ZZ.le.1.7) then
		ww=((1.7-ZZ)/0.2)
		abun0=ww*abun_tot15+(1d0-ww)*abun_tot17
	else
		abun0=abun_tot17
	endif
	abun0=10d0**abun0
	
	return
	end
	
	
	
	